CREATE TABLE airports (
	scalerank numeric NULL,
	featurecla varchar NULL,
	"type" varchar NULL,
	name varchar NULL,
	abbrev text NULL,
	"location" varchar NULL,
	gps_code text NULL,
	iata_code text NULL,
	wikipedia text NULL,
	natlscale numeric NULL,
	cartodb_id numeric NULL,
	created_at varchar NULL,
	updated_at varchar NULL,
	id numeric NULL,
	geom public.geometry(multipoint) NULL
);

